import React from 'react';
import {Container,Col} from 'react-bootstrap'
const AfficheVoiture = (props) => {
    const {Voiture} = props
    return (
        <Container>
            <Col sm={3}> <p> AfficheVoiture {Voiture.marque} </p> </Col>
        </Container>
    );
};

export default AfficheVoiture;
